import React from 'react';
import { Text, View, Image } from 'react-native';

import HeaderStyle from '../styles/HeaderStyle';
import CourseImage from '../images/course.png';

const Header = () => {
  return (
    <View>
      <Image uri={CourseImage}/>
    </View>
  )
};

export default Header;
